import './App.css';
import React from 'react';
import Header from './Header';
import Navbar from './Navbar';
import Catalog from './Catalog';

function App() {
  return (
    <div className="App">
      <Header/>
      <Navbar/>
      <Catalog />
    </div>
  );
}

export default App;

